    public final static int
           NUM_STATES        = 522,
           NT_OFFSET         = 124,
           LA_STATE_OFFSET   = 5871,
           MAX_LA            = 2147483647,
           NUM_RULES         = 525,
           NUM_NONTERMINALS  = 195,
           NUM_SYMBOLS       = 319,
           SEGMENT_SIZE      = 8192,
           START_STATE       = 2855,
           IDENTIFIER_SYMBOL = 0,
           EOFT_SYMBOL       = 121,
           EOLT_SYMBOL       = 121,
           ACCEPT_ACTION     = 4999,
           ERROR_ACTION      = 5346;

